const{default:axios}=require("axios"),axiosInstance=axios.create({baseURL:"http://localhost:3001",withCredentials:!0});axiosInstance.interceptors.response.use((res=>res),(async error=>{if(401===error.response?.status)try{return await axios.post("http://localhost:3001/auth/refresh",{},{withCredentials:!0}),axios(error.config)}catch(err){console.err("Refresh token failed:",err)}return Promise.reject(error)}));